	$('.shop-system-select .item-2 select').change(function () {
		var id = $(this).val();
		var text = $('option:selected', this).val();
		$('.shop-systems .woodmart-list').removeClass('active');
		$('.shop-systems .woodmart-list.' + text).addClass('active');
	});

